import CardDetailsBack from "./CardDetailsBack";
import backOfCardImage from "../images/bgCardBack.png";

const BackOfCard = (props) => {
  return (
    <div className="back-of-card-img">
      <img src={backOfCardImage} alt="back of a credit card" />
      <CardDetailsBack cardCvc={props.cardCvc} />
    </div>
  );
};

export default BackOfCard;
